import React from 'react';
import Image from 'react-bootstrap/Image'
import me from './picture.JPG'
import './Picture.css'
import { FaGithub, FaLinkedin } from 'react-icons/fa';

class Pic extends React.Component {
  render() {
    return (
      <div className="picture">
        <div className="intro p-3">
          <h1 className="mt-0 mb-0 ml-2 mr-2">Fangting Chen</h1>
          <h5 className="mt-0 ml-2 mr-2"> 
            Hi! I’m currently in my final year of Computing Science at the University of Alberta 
            and seeking full-time job opportunities starting in Summer 2020.
            <br/>
            I’m passionate about software development and I love bringing innovative ideas to life. 
            Well-versed in user-focused design; I’m eager to develop intuitive and user-friendly experiences.

          </h5>
          <span> 
            <a href='https://www.linkedin.com/in/fangting-chen-73114b1a0/' style={{color: '#fff'}} target="_blank" rel="noopener noreferrer">
                <FaLinkedin className='mr-2 ml-2' size={50}/> 
            </a>
            <a href='https://github.com/Finicft' style={{color: '#fff'}} target="_blank" rel="noopener noreferrer">
                <FaGithub className='mr-2 ml-2' size={50}/>
            </a>
          </span>

        </div>

        <Image src={me} alt="picture of me" fluid />

      </div>
    );

    }
}

export default Pic;
